import React from "react";
import '../Assets/Styles/SkillPageStyles.css';

function SkillPage(){
    return(
        <main className="main" id="skill">
            <section>
                <h1>My Skills as a Developer</h1>
            </section>
        </main>
    );
}

export default SkillPage;
